description:
Promotional info for the collected edition - &quot;A powerful story about loss of freedom and individuality, V FOR VENDETTA takes place in a totalitarian England following a devastating war that changed the face of the planet. 

In a world without political freedom, personal freedom and precious little faith in anything comes a mysterious man in a white porcelain mask who fights political oppressors through terrorism and seemingly absurd acts. It's a gripping tale of the blurred lines between ideological good and evil.&quot;

This is all ten issues of Alan Moore's classic story in digital form. Thanks to Zone-Empire for these rips. Please seed and enjoy.

